import React from 'react';
import { Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, Collapse, Alert } from 'reactstrap';
import { Link, useLocation } from 'react-router-dom';

function NavbarComponent({ toggle, isOpen }) {
 const location = useLocation();

 if (location.pathname.startsWith('/admin')) {
    return (
      <Navbar color="dark" dark expand="sm">
        <NavbarBrand href="/">CUET Medical Center - Admin</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav style={{width: "100%", justifyContent: "flex-end"}} navbar>
            <NavItem style={{paddingRight: "10px"}}>
            <NavLink tag={Link} to="/admin/home" className="btn btn-light btn-outline-primary">
                Home
            </NavLink>
            </NavItem>
              <NavItem style={{paddingRight: "10px"}}>
                <NavLink tag={Link} to="admin/booklet" className="btn btn-light btn-outline-primary">
                 Booklet
                </NavLink>
              </NavItem>
              <NavItem style={{paddingRight: "10px"}}>
                <NavLink tag={Link} to="/admin/doctor" className="btn btn-light btn-outline-primary">
                 Doctor
                </NavLink>
              </NavItem>
              <NavItem style={{paddingRight: "10px"}}>
                <NavLink tag={Link} to="/admin/roster" className="btn btn-light btn-outline-primary">
                 Roster
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink tag={Link} to="/admin/roster" className="btn btn-light btn-outline-primary">
                 Logout
                </NavLink>
              </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    );
 }

 if (location.pathname.startsWith('/student')) {
    return (
      <Navbar color="dark" dark expand="sm">
        <NavbarBrand href="/">CUET Medical Center - Student</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav style={{width: "100%", justifyContent: "flex-end"}} navbar>
           <NavItem style={{paddingRight: "10px"}}>
           <NavLink tag={Link} to="/student/home" className="btn btn-light btn-outline-primary">
                Home
            </NavLink>
           </NavItem>
           {/* Add other student routes here */}
          </Nav>
        </Collapse>
      </Navbar>
    );
 }

 if (location.pathname === '/student') {
    return (
      <Alert color="warning">
        You are not verified. Please verify your account to continue.
      </Alert>
    );
 }

 return null;
}

export default NavbarComponent;
